import React from 'react'
import {Text} from 'react-native'

const CommitteeDetailByMembers =()=>{

return (

<Controller
            control = {control}
            render ={({ field:{ onChange, onBlur, value}})=>
            (
                <TextInput 
                label="Email"
                mode="outlined"
                onBlur={onBlur}
                onChangeText={onChange}
                />
            )}

            name="email"
            rules={{ required: true}}
            defaultValue=""        

            />

)



}

export default CommitteeDetailByMembers;
